IF OBJECT_ID('dbo.proc_transform_207', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_207;
GO
CREATE PROCEDURE dbo.proc_transform_207
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_207
    SET payload = LEFT(payload, 1000) + N'|V4-207|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_207;
END
